import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
function App() {
  let Todo = ["charger", "power bank", "bedsheet", "mobile phone"]
  return (
    <div className="App table" border={1}>
      <tr>
        <th>Order</th>
        <th>Value</th>
      </tr>
      {Todo.map((t,i) => <tr>
        <td>{i+1}</td>
        <td>{t}</td>
      </tr>)}
    </div>
  );
}
export default App;
